import React from 'react';
import './Scanner.css'; 

function Scanner() {
  return (
    <div className="container">
      <div className="focus-box">
        <img src="path/to/your/qr-code.png" alt="QR Code" className="qr-code" />
      </div>
    </div>
  );
}

export default Scanner;
